$templateCache.put("app/ambiental/ambiental.html","<section class=\"Section-3r\">\n    <h1 class=\"Titulo-page\">\n        Pocket Medic Ecologico\n    </h1>\n    <h4 class=\"Descriccion-page\">\n        En este espacio te diremos nuestras propuestas para mejorar el medio ambiente\n        desde tu casa y/o oficina, Y esperamos incentivarte a ayudar no solo a nosotros,\n        Si no a todo el planeta.\n    </h4>\n    <div class=\"Div-3r\">\n        <h2 class=\"Titulo-3r\">\n            Las 3R\n        </h2>\n        <p class=\"Info-3r\">\n          Esta regla está formada por: reducir, reutilizar y reciclar.\n          Esta regla sirve para tener un mundo sano y limpio sin embargo algunas personas no la respetan por que dicen\n          \"ay… que tanto es tirar basura en la calle\" o \"yo no reciclo, pero otras personas si\" en realidad todos deberían decir:\n          \"hay que recoger la basura y a reciclarla\" o \"hay que reciclar la basura para tener un planeta más limpio o simplemente:\n          \"<strong>¡cuida el planeta!.</strong>\"\n        </p>\n        <figure class=\"Image3r-container\">\n        <img class=\"Image3r\" src=\"../../img/3r.png\" width=\"300\" height=\"150\"/>\n        </figure>\n    </div>\n    <aside class=\"Video3r-container\">\n      <h2 class=\"TituloVideo-3r\">\n          Como aplicar las 3R?\n        </h2>\n        <iframe width=\"500\" height=\"400\" src=\"https://www.youtube.com/embed/wi2PaIbliE8\" frameborder=\"0\" class=\"VIdeo3r\"></iframe>\n    </aside>\n    <div class=\"Div-3r\">\n        <h2 class=\"Titulo-3r\">\n          Ahorro De Agua\n        </h2>\n          <p class=\"Info-3r\">\n            El agua es uno de los bienes más preciados del planeta, por eso cuidarla se ha convertido en un deber de todos nosotros.\n            El agua potable, proveniente de ríos, lagos o del agua subterránea, se encuentra repartida de forma desigual,\n            estando la mitad de la población mundial sin acceso a ella. Mientras que en aquellos lugares donde se la tiene con facilidad,\n            por lo general se malgasta\n          </p>\n          <figure class=\"Image3r-container img\">\n            <img class=\"Image3r\" src=\"../../img/ahorro-de-agua.jpg\" width=\"300\" height=\"200\"/>\n          </figure>\n      </div>\n      <aside class=\"Video3r-container\">\n      <h2 class=\"TituloVideo-3r\">\n            !Ayudar Al Planeta Ahorrardo Agua¡\n      </h2>\n      <iframe width=\"500\" height=\"400\" src=\"https://www.youtube.com/embed/1nk5obhE_E0\" frameborder=\"0\" class=\"VIdeo3r\"></iframe>\n    </aside>\n    <div class=\"Div-ecoTips\">\n        <h2 class=\"Titulo-V\">\n          !Ecotips Para El Ahorro De Agua¡\n        </h2>\n          <p class=\"Info-3r\">\n            <strong>1.</strong> Repare cualquier grifo que gotee y asegúrese de cerrar bien las llaves.\n          </p>\n          <p class=\"Info-3r\">\n            <strong>2.</strong> Riegue con agua lluvia su jardín. Hágalo una vez por semana.\n          </p>\n          <p class=\"Info-3r\">\n            <strong>3.</strong> Opte por el lavado ecológico para su vehículo,\n                                que se puede realizar con productos que ofrece el mercado para limpiar y brillar el carro,\n                                sin usar una gota de agua. También puede prescindir de la manguera y usar un balde con agua.\n          </p>\n          <p class=\"Info-3r\">\n            <strong>4.</strong> Cierre la llave del lavamanos mientras se cepilla los dientes o se baña su rostro.\n          </p>\n          <p class=\"Info-3r\">\n            <strong>5.</strong> Lave las frutas y las verduras en un recipiente con agua y no las limpie bajo el grifo.\n          </p>\n          <p class=\"Info-3r\">\n            <strong>6.</strong> No deje correr el agua mientras lava los platos\n          </p>\n    </div>\n      <div class=\"Div-3r\">\n          <h2 class=\"Titulo-3r\">\n            Diminuir El uso De papel\n          </h2>\n          <p class=\"Info-3r\">\n                            El agua es uno de los bienes más preciados del planeta, por eso cuidarla se ha convertido en un deber de todos nosotros.\n                            El agua potable, proveniente de ríos, lagos o del agua subterránea, se encuentra repartida de forma desigual,\n                            estando la mitad de la población mundial sin acceso a ella. Mientras que en aquellos lugares donde se la tiene con facilidad,\n                            por lo general se malgasta\n          </p>\n      </div>\n      <aside class=\"Video3r-container\">\n          <h2 class=\"TituloVideo-3r\">\n            Como Lo Hago?\n          </h2>\n          <iframe width=\"500\" height=\"400\" src=\"https://www.youtube.com/embed/m91pIZZm5q0\" frameborder=\"0\" class=\"VIdeo3r\"></iframe>\n      </aside>\n        <div class=\"Div-3r\">\n            <h2 class=\"Titulo-3r\">\n              Manejo De Residuos\n            </h2>\n            <p class=\"Info-3r\">\n                            La temática “manejo adecuado de residuos sólidos y procesos de reciclaje”\n                            busca generar una conciencia de reducción y consumo responsable, mostrando que la elevada generación de residuos sólidos,\n                            comúnmente conocidos como basura y su manejo inadecuado son uno de los grandes problemas ambientales y de salud,\n                            los cuales se han acentuado en los últimos años debido al aumento de la población y a los patrones de producción y consumo,\n                            mostrando algunas alternativas y usos que se pueden dar a materiales que comúnmente son desechados como “basura”.\n            </p>\n              <figure class=\"Image3r-container\">\n                <img class=\"Image3r\" src=\"../../img/grandes.jpg\" width=\"300\" height=\"150\"/>\n              </figure>\n            </div>\n            <aside class=\"Video3r-container\">\n                  <h2 class=\"TituloVideo-3r\">\n                    Manejo Responsable De Los Residuos\n                  </h2>\n                <iframe width=\"500\" height=\"400\" src=\"https://www.youtube.com/embed/7_bmJlXJLqE\" frameborder=\"0\" class=\"VIdeo3r\"></iframe>\n            </aside>\n            <div class=\"Div-ecoTips\">\n                <h2 class=\"Titulo-V\">\n                    !Ecotips Para El Manejo De Los Residuos¡\n                </h2>\n                <p class=\"Info-3r\">\n                    <strong>1.</strong> Lleva contigo una bolsa de tela para que no utilices bolsas de plástico cuando hagas compras.\n                </p>\n                <p class=\"Info-3r\">\n                    <strong>2.</strong> Convierte tu basura orgánica en composta.\n                </p>\n                <p class=\"Info-3r\">\n                    <strong>3.</strong> Separa tus residuos al menos en orgánicos e inorgánicos y si es posible en reciclables\n                            (papel, aluminio, vidrio, cartón, tetrapack, etc).\n                </p>\n                <p class=\"Info-3r\">\n                    <strong>4.</strong> Usa las hojas de papel por ambos lados.\n                </p>\n                <p class=\"Info-3r\">\n                    <strong>5.</strong> Utiliza pilas recargables.\n                </p>\n                <p class=\"Info-3r\">\n                    <strong>6.</strong> Localiza centros de acopio que compren materiales reciclables.\n                </p>\n            </div>\n</section>\n");
